import {appMar} from "../reder";

let data = {



    "dlee": [],

    "sas": ""
};


export let handlerPush = (messa) => {

    data.dlee.push(messa);
    appMar(data);
}



export let hanlderChang = (prop) => {
    data.sas = prop;

    data.dis = data.dc.filter((number) => {
        return number.name.toLowerCase().indexOf(prop) !== -1;
    });
    appMar(data);
};

export let handlerIn = () => {
    data.sas = "";
    hanlderChang("");
    appMar(data);

}


export default data;
